PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
ASK WHERE {
  ?person wdt:P21 wd:Q6581072 .
  {
    ?person wdt:P19 wd:Q3240 .
  } UNION {
    ?person wdt:P20 wd:Q3240 .
  }
  ?person wdt:P570 ?dateOfDeath .
  FILTER ( ?dateOfDeath < "1948-01-01" ^^ xsd:dateTime )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ( COUNT( ?partner ) AS ?numPartners ) ( COUNT( DISTINCT ?femaleArtist ) AS ?numFemaleArtists ) ( COUNT( DISTINCT ?maleArtist ) AS ?numMaleArtists ) WHERE {
  {
    ?artist wdt:P21 wd:Q6581072 ; wdt:P106 ?occupation .
    FILTER ( ?occupation = wd:Q488202 || ?occupation = wd:Q177220 ) OPTIONAL {
      ?artist wdt:P45 ?partner .
    }
    BIND( ?artist AS ?femaleArtist )
  } UNION {
    ?artist wdt:P21 wd:Q6581097 ; wdt:P106 ?occupation .
    FILTER ( ?occupation = wd:Q488202 || ?occupation = wd:Q177220 ) OPTIONAL {
      ?artist wdt:P45 ?partner .
    }
    BIND( ?artist AS ?maleArtist )
  }
}
GROUP BY ?numPartners
ORDER BY ?numPartners

