PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?goat ?goatLabel ?image ?startTime ?endTimeFinal WHERE {
  wd:Q104770 p:P822 ?statement .
  ?statement ps:P822 ?goat .
  ?goat rdfs:label ?goatLabel .
  FILTER ( LANG( ?goatLabel ) = "en" && LCASE( ?goatLabel ) = "billygoat hennes" ) OPTIONAL {
    ?goat wdt:P18 ?image
  }
  OPTIONAL {
    ?statement pq:P580 ?startTime
  }
  OPTIONAL {
    ?statement pq:P582 ?endTime
  }
  BIND( COALESCE ( ?endTime , NOW () ) AS ?endTimeFinal )
}

