SELECT ?settlement ?settlementLabel ?settlementCoordinates ?meznoCoordinates ( geof:distance ( ?settlementCoordinates , ?meznoCoordinates ) / 1000 AS ?distance ) WHERE {
  wd:Q2180733 wdt:P625 ?meznoCoordinates .
