PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?business ?businessLabel ?revenue ?location ?revenueDate ?netProfit ?profitMargin ?revenueUnit WHERE {
  ?business wdt:P159 wd:Q213 .
  ?business wdt:P2139 ?revenue .
  ?business wdt:P159 ?location .
  FILTER ( ?business != wd:Q100707321 && ?business != wd:Q12021780 ) .
  OPTIONAL {
    ?business wdt:P585 ?revenueDate .
  }
  OPTIONAL {
    ?business wdt:P2295 ?netProfit .
  }
  BIND( ( ?netProfit / ?revenue ) AS ?profitMargin ) .
  BIND( ROUND( ?profitMargin * 100 ) / 100 AS ?roundedProfitMargin ) .
  OPTIONAL {
    ?business wdt:P8111 ?revenueUnit .
  }
  OPTIONAL {
    ?business rdfs:label ?businessLabel .
    FILTER ( LANG( ?businessLabel ) = 'en' )
  }
}
ORDER BY ASC ( ?roundedProfitMargin )
LIMIT 20

PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?entity ?entityLabel ( MAX( ?population ) AS ?latestPopulation ) ( MAX( ?area ) AS ?latestArea ) ( MAX( ?populationDate ) AS ?latestPopulationDate ) WHERE {
  VALUES ?entity {
    wd:Q884 wd:Q31057 wd:Q35555 wd:Q220982 wd:Q31063 wd:Q475038
  }
  ?entity wdt:P1082 ?population .
  ?entity wdt:P2046 ?area .
  ?entity p:P1082 ?populationStatement .
  ?populationStatement pq:P585 ?populationDate .
  {
    SELECT ?entity ( MAX( ?popDate ) AS ?latestPopDate ) WHERE {
      VALUES ?entity {
        wd:Q884 wd:Q31057 wd:Q35555 wd:Q220982 wd:Q31063 wd:Q475038
      }
      ?entity p:P1082 ?populationStatement .
      ?populationStatement pq:P585 ?popDate .
    }
    GROUP BY ?entity
  }
  FILTER ( ?populationDate = ?latestPopDate ) FILTER NOT EXISTS {
    ?entity wdt:P206 ?lagoon .
  }
  FILTER NOT EXISTS {
    ?entity wdt:P757 ?worldHeritageSite .
  }
  FILTER NOT EXISTS {
    ?entity wdt:P3018 ?protectedArea .
  }
  FILTER NOT EXISTS {
    ?entity wdt:P1336 ?territorialClaim .
  }
  OPTIONAL {
    ?entity rdfs:label ?entityLabel .
    FILTER ( LANG( ?entityLabel ) = "en" )
  }
}
GROUP BY ?entity ?entityLabel
ORDER BY ?entity

