PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?country ( COUNT( ?airport ) AS ?operationalAirports ) ( SAMPLE( ?population ) AS ?countryPopulation ) WHERE {
  ?airport wdt:P31 wd:Q1248784 .
  OPTIONAL {
    ?airport wdt:P17 ?country
  }
  FILTER NOT EXISTS {
    ?airport wdt:P576 []
  }
  FILTER NOT EXISTS {
    ?airport wdt:P582 []
  }
  ?country wdt:P31 wd:Q6256 .
  ?country wdt:P1082 ?population .
}
GROUP BY ?country

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?item WHERE {
  VALUES ?class {
    wd:Q11471 wd:Q2199864
  }
  ?item wdt:P31 ?class .
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT ?member ?startTime WHERE {
  ?member wdt:P39 wd:Q29169698 .
  ?member p:P39 ?statement .
  ?statement ps:P39 wd:Q29169698 .
  OPTIONAL {
    ?statement pq:P580 ?startTime .
  }
  FILTER NOT EXISTS {
    ?statement pq:P582 ?endTime .
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?event ?tournament ?year ?country ?surface ?prizeMoney ?participants WHERE {
  VALUES ?event {
    wd:Q924193 wd:Q739300 wd:Q739301 wd:Q739302
  }
  ?event wdt:P31 wd:Q102113 .
  OPTIONAL {
    ?event wdt:P118 ?tournament
  }
  .
  OPTIONAL {
    ?event wdt:P585 ?year
  }
  .
  OPTIONAL {
    ?event wdt:P17 ?country
  }
  .
  OPTIONAL {
    ?event wdt:P1017 ?surface
  }
  .
  OPTIONAL {
    ?event wdt:P2121 ?prizeMoney
  }
  .
  OPTIONAL {
    ?event wdt:P1167 ?participants
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?candidate WHERE {
  VALUES ?election {
    wd:Q93307086 wd:Q93307088 wd:Q93307089 wd:Q96279006
  }
  {
    ?election wdt:P726 ?candidate
  } UNION {
    ?candidate wdt:P3602 ?election
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ( COUNT( ?person ) AS ?count ) WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P19 wd:Q668 .
}
